/* *//* BEGIN CODE MAP  END CODE MAP */
import {read} from 'file';

let gbks = new Uint16Array(65536), unicodes = new Uint16Array(65536);

{ // initialize list
    let buf = read(__filename).slice(0, 1 << 18);
    buf.write('000000000000000000000000', 0);
    buf.write('0000000000000000', (1 << 18) - 16);
    buf = new Buffer(buf.toString('binary'), 'hex');

    for (let i = 128; i < 65536; i++) {
        let gbk = buf.readUInt16LE(i << 1);
        if (gbk) {
            gbks[i] = gbk;
            unicodes[gbk] = i;
        }
    }
}

/**
 *
 * @param {string} str
 * @param {Buffer} buf
 * @returns {number} number of bytes written
 */
export function write(str, buf) {
    let strLen = str.length, len = 0;
    for (let i = 0; i < strLen; i++) {
        let ch = str.charCodeAt(i);
        if (ch < 128) {
            buf[len++] = ch;
        } else {
            let gbk = gbks[ch];
            if (!gbk) {
                let code = str.charCodeAt(i).toString(16);
                throw new Error('unmappable character: \\u' + '0000'.substr(code.length) + code + ' at index ' + i);
            }
            buf[len++] = gbk >> 8;
            buf[len++] = gbk;
        }
    }
    return len;
}

/**
 *
 * @param {string} str
 * @returns {Buffer}
 */
export function encode(str) {
    let encoded = new Buffer(str.length << 1);
    let len = write(str, encoded);
    return encoded.slice(0, len);
}

/**
 *
 * @param {Buffer} buffer
 * @returns {String}
 */
export function decode(buffer) {
    let bufLen = buffer.length, len = 0;
    let decoded = new Buffer(bufLen << 1);
    for (let i = 0; i < bufLen; i++) {
        let ch = buffer[i];
        if (ch < 128) {
            decoded[len++] = ch;
            decoded[len++] = 0;
        } else {
            ch = ch << 8 | buffer[++i];
            let unicode = unicodes[ch];
            if (unicode) { // found
                decoded[len++] = unicode;
                decoded[len++] = unicode >> 8;
            } else {
                i--;
                decoded[len++] = 0xFD;
                decoded[len++] = 0xFF;
            }
        }
    }
    return decoded.slice(0, len).toString('utf16le');
}
